import XCTest
@testable import LevelDBForSwift

class LevelDBForSwiftTests: XCTestCase {
    
    override func setUp() {
        super.setUp()
        // Put setup code here. This method is called before the invocation of each test method in the class.
    }
    
    override func tearDown() {
        // Put teardown code here. This method is called after the invocation of each test method in the class.
        super.tearDown()
    }
    
    func testString() {
        let db = LevelDB(name: "test")
        let value = ""
        db["string"] = value
        let value1 = db["string"]
        XCTAssertNotNil(value1)
        XCTAssertEqual(value, value1)
    }
    
    func testData() {
        let db = LevelDB(name: "test")
        
        let stringData = "1234567890=🆚😂".data(using: .utf8)
        XCTAssertNotNil(stringData)
        db.set(stringData!, forKey: "dataTest")
        let data = db.getData(forKey: "dataTest")
        XCTAssertNotNil(data)
        for (index,dataItem) in data!.enumerated() {
            XCTAssertEqual(dataItem, data![index])
        }
        
    }
    
    func testPerformanceExample() {
        // This is an example of a performance test case.
        self.measure {
            // Put the code you want to measure the time of here.
        }
    }
    
}
